import React, { useState } from 'react'
import { Link } from 'react-router-dom';

const Login = () => {

  const [formData,setFormData]= useState({
    email:'',
    password:''
  });

  const handleChange=(e)=>{
    setFormData({...formData, [e.target.name]:e.target.value})
  }
  const handleSubmit=(e)=>{
    e.preventDefault();
    // axios.post("http://lcalhost:4000/login",formData)
    console.log("hello world")
  }

  return (
    <div className='flex  flex-col m-8 max-w-lg shadow-xl p-6  ' >
      <h3 className='text-lg font-bold'>sign Up</h3>
      <form onSubmit={handleSubmit} className=' flex flex-col space-y-4 pl-4'>
        <input  
          type='email' 
          name='email' 
          onChange={handleChange} 
          className='h-8 border border-blue-200'/>
        <input  
          type='password' 
          name='password' 
          onChange={handleChange} 
          className='h-8 border border-blue-200' />
        <button type='submit' className='h-8 bg-green-500  rounded-md'>submit</button>
          <button type='submit' className='h-8 bg-blue-600 rounded-md'>continue with Google</button>
      </form>

      <div className=''>
        <p>if you haven,t an account? </p>
        <Link to={'/signup'}>signup</Link>
      </div>

    </div>
  )
}

export default Login;
